import './App.css';
import Sidebar from './components/sidebar/sidebar';
import Home from './pages/home/home';


function App() {
  return (
    <div className="App">
      <Home />
      <Sidebar />
      <Router>

          <Route exact path="/" />
          <Route path="/about" />
          <Route path="/contact" />


    </Router>
    </div>
  );
}

export default App;
